import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="imgbox">
          <img src="https://images.unsplash.com/photo-1584593744969-4731ae13ef24?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9" className="centre-fit" alt="bg" />
        </div>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
